As you know, compilation is the conversion of your high-level C code into assembly and then into machine code that the computer can understand. Lucky for you, nearly every Linux machine comes with the most popular compiler gcc. I did say the most popular compiler though, there are actually a few that people use . For simplicity, we will only refer to gcc as our compiler. Let's compile a simple program: int main()
{ for(int i; i < 10000; i++) { puts("hello world"); }
} Recall: you can place text in a file using "vim filename" $ cat ex.c
int main()
{ for(int i; i < 10000; i++) { puts("hello world"); }
} Compile it by passing its name to gcc: gcc ex.c Now you will have a file named a.out in the same directory. You can execute it by running ./a.out. $ ./a.out
hello world
hello world
hello world [truncated]
hello world Yay you can compile and execute now! Let's talk about common compiler flags.

