When you have the source for a program, debugging it is very easy. You compile the binary we used in the last secion again with -g flag which makes it have symbols and be in a ready form for gdb. gcc ex.c -o ex -g Now run the binary with gdb ./ex You will now see a bunch of text ending in: Reading symbols from ./ex...
(gdb) You are in the gdb prompt now. To exit you can type exit and hit enter. For now we will stay and run a few commands. Since symbols exist, you can just break at any line in the source you like. Breaking is the stopping of code at a certain condition. When you set a breakpoint you tell the debugger to stop the program at a certain symbol or address. Run: b main:1
r We said break at line 1 in the main function and run. Type l and now you will see where you are: (gdb) l
1	int main()
2	{
3 for(int i; i < 10000; i++) {
4 puts("hello world");
5 }
6	} Very cool. Now if we enter the command n (next) twice, we will be inside the loop. We can print the value of i at each iteration: (gdb) n
3 for(int i; i < 10000; i++) {
(gdb) n
4 puts("hello world");
(gdb) p i
$1 = 0 We can even change the value of i: (gdb) set variable i=10000
(gdb) n
hello world
3 for(int i; i < 10000; i++) {
(gdb)
6	} Now we leave the loop since we set i. This was all possible because -g mapped every symbol that we see in the source to a corresponding address, stack variable, and region in the programs memory. You can find more tutorials on debugging programs you wrote here . This is often where other manuals about debugging in gdb will stop... but not use. A real systems hacker needs to know how to debug programs they did not write and don't have the source too.
